define({"topics" : [{"title":"Static test suites","shortdesc":"\n                     <p class=\"shortdesc\">A static test suite is a collection of test modules that are grouped manually for test   execution purposes.</p>\n                  ","id":"static_test_suites","href":"TA_Help\/Topics\/Test_suite_static.html","menu": {"hasChildren":false,},"tocID":"static_test_suites-d46e20855","next":"static_test_suites-d46e20855",},{"title":"Dynamic test suites","shortdesc":"\n                     <p class=\"shortdesc\">A dynamic test suite is a collection of test modules whose membership is determined   dynamically, based on the criteria specified\n                        in an associated data profile.\n                     </p>\n                  ","id":"dynamic_test_suites","href":"TA_Help\/Topics\/Test_suite_dynamic.html","menu": {"hasChildren":false,},"tocID":"dynamic_test_suites-d46e20899","next":"dynamic_test_suites-d46e20899",},{"title":"Moving test suites, test suite folders, and modules","shortdesc":"\n                     <p class=\"shortdesc\">Static and dynamic test suites, test suite folders, and modules within the same project   can be moved and copied around the\n                        <span class=\"ph\">TestArchitect explorer tree</span>.\n                     </p>\n                  ","id":"manage_test_suite","href":"TA_Help\/Topics\/Test_suite_cut_copy_paste.html","menu": {"hasChildren":false,},"tocID":"manage_test_suite-d46e20958","topics":[]},{"title":"Executing a test suite","shortdesc":"\n                     <p class=\"shortdesc\">Both static test suites and dynamic test suites can be executed from the       <span class=\"ph uicontrol\">Execute Test</span> dialog box.\n                     </p>\n                  ","id":"execute_MTM_test_suite","href":"TA_Help\/Topics\/Test_suite_executing.html","menu": {"hasChildren":false,},"tocID":"execute_MTM_test_suite-d46e20972","topics":[]}]});